import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { Stack } from '@mui/material';
import axios from 'axios'

export interface Settings {
  hosts:              number;
  expected_instances: number;
  enabled_services:   number;
}

export function MediaCard() {
  const [data,setData]=React.useState<Settings[]>([]);
  const getProductData = async () => {

    let url='http://127.0.0.1:8000/api/settings/';

    try {


      const data = await axios.get<Settings[]>(
        url
      );

      setData(data.data);
      console.log("Data:"+{data});
    } catch (e) {

      console.log(e);
    }
  };

React.useEffect(() => {
    getProductData();
},[] );
  return (
    <Card sx={{ maxWidth: 350 ,boxShadow:3,m:1}}>
      <CardContent>

      </CardContent>
      <CardActions>
        <Button size="small">View Details</Button>

      </CardActions>
    </Card>
  );
}

export function NotificationsCard() {
  return (
    <Card sx={{ maxWidth: 500 ,boxShadow:3,m:1}}>
      <CardMedia
        component="img"
        height="140"
        image=""
        alt="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}

export function HealthCard() {
  return (
    <Card sx={{ maxWidth: 570 ,boxShadow:3,m:1}}>
      <CardMedia
        component="img"
        height="140"
        image=""
        alt="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}



export const Home=()=>{

  return(

    <Box
        component="main"
        // sx={{ flexGrow: 1, p: 3, marginLeft: {  sm: `200px`, md: `200px`}}}>
          sx={{ flexGrow: 0,p:3,display:'flex',alignItems:'center',position:'relative'}}> 

        <Toolbar />
        {/* <h1>Home</h1> */}
        <Stack direction="column">
       <Stack direction="row">
        <MediaCard/>
        <MediaCard/>
        <MediaCard/>
        </Stack>
        <Stack direction="row">
          <NotificationsCard/>
          <HealthCard/>
          </Stack>
          </Stack>

    </Box>
  )

}
